import React from "react";
import "./Shared.css";
import "./Contact.css";
import "./Footer.css";
import { Footer } from "./Footer";


export const Contact: React.FC = () => {
    return (
        <div>
          <div className="header contact-header">
            <div className="overlay"></div>
            <div className="ingress">
              <h1 className="white">Give us a shout.</h1>
              <p>We believe VR is going to open up a new dawn of mental health therapeutics. It's a very exciting time for neuroscience, and if you're excited about it too, we'd love to talk. Chats about Unity, Blender, Meshroom, Meshlab, LIDAR, iMotions, R, VSM, neural nets, graph theory, 'Bayesian' psychology, systemic psychotherapy, cognitivist therapy, reality therapy, systems engineering, cybernetics, structural-functionalism or branching morphogenesis are always welcome.</p>
            </div>
          </div>

          <div className="main">
            <h2>
              Why start a company?
            </h2>
            <p>
              We would love to hear from you, please <a href="mailto:info@csd.red">reach out to us </a>.
            </p>
            <Footer />
          </div>
        </div>
    );
};
